import React from "react";
import { TextField, Button, Paper, Typography, Stack } from "@mui/material";

export default function ProfileInfo() {
  const inputStyle = {
    "& .MuiTextField-root": {
      paddingBottom: "10px",
      fontSize: "10px",
    },
    "& .MuiButton-root": { fontSize: "12px", px: 4, py: 1.5 },
  };
  return (
    <>
      <div>
        <form>
          <TextField
            sx={inputStyle}
            fullWidth
            label="نام کاربری"
            variant="outlined"
          />
          <TextField
            sx={inputStyle}
            fullWidth
            label="رمز عبور"
            variant="outlined"
          />
        </form>
      </div>
    </>
  );
}
